{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/marvinbulahan/case-study-money-reimagined?scriptVersionId=189699710\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"520f7102","metadata":{"papermill":{"duration":0.00646,"end_time":"2024-07-25T08:23:05.78498","exception":false,"start_time":"2024-07-25T08:23:05.77852","status":"completed"},"tags":[]},"source":["### **Case Study**\n","# **Money Reimagined: A Comparative Analysis on the Evolution of Traditional(Fiat) and Crypto Currencies**\n","\n","**Author:** Marvin Bulahan  \n","**Date:** `r Sys.Date()`"]},{"cell_type":"markdown","id":"98f8a51a","metadata":{"papermill":{"duration":0.005913,"end_time":"2024-07-25T08:23:05.798763","exception":false,"start_time":"2024-07-25T08:23:05.79285","status":"completed"},"tags":[]},"source":["## Introduction\n","[Money](https://www.kaggle.com/datasets/marvinbulahan/documents?select=Brief+History+of+Fiat+Money+and+Cryptocurrency.pdf) has undergone significant evolution, transitioning from barter systems to metal coins, paper money, and now digital currencies. For centuries, fiat money, issued by governments and central banks, has been the primary medium of exchange in the global economy. The advent of cryptocurrencies, particularly Bitcoin in 2009, introduced a decentralized form of digital money that operates without a central authority. This innovation has ignited widespread interest and debate about the future of money.\n"]},{"cell_type":"markdown","id":"a3944d4c","metadata":{"papermill":{"duration":0.004708,"end_time":"2024-07-25T08:23:05.808348","exception":false,"start_time":"2024-07-25T08:23:05.80364","status":"completed"},"tags":[]},"source":["## Scenario (Fictional)\n","As a junior data analyst at FinTech Future Solutions, a forward-thinking financial company, I have been tasked with exploring whether adopting cryptocurrencies would align with the company's vision. FinTech Future Solutions has successfully integrated artificial intelligence and blockchain technology into its operations, enhancing efficiency and transparency. Now, the leadership team is considering whether adopting cryptocurrencies would be a strategic move to further align with their vision of creating a financial institution fit for the future of civilization.\n","\n","### Company Vision\n","FinTech Future Solutions envisions a financial ecosystem that is:\n","- Inclusive: Providing financial services to underserved populations worldwide.\n","- Secure: Utilizing the latest technology to ensure the highest levels of transaction security.\n","- Innovative: Leading in the adoption of new technologies to stay ahead of the curve.\n","- Sustainable: Ensuring that financial practices contribute positively to economic stability and environmental sustainability.\n"]},{"cell_type":"markdown","id":"3072944b","metadata":{"papermill":{"duration":0.005025,"end_time":"2024-07-25T08:23:05.818014","exception":false,"start_time":"2024-07-25T08:23:05.812989","status":"completed"},"tags":[]},"source":["## Objective\n","This study aims to compare and contrast traditional fiat money with cryptocurrencies concerning stability, security, and future potential, providing stakeholders with a comprehensive understanding of the historical background and fundamental aspects of cryptocurrencies.\n","\n","### Issues stakeholders want to address\n","| Issue                      | Description                                                                                  |\n","|----------------------------|----------------------------------------------------------------------------------------------|\n","| **Regulatory Compliance**  | Challenges related to cryptocurrency regulations and compliance.                             |\n","| **Market Volatility**      | Risks associated with the high volatility of cryptocurrencies.                               |\n","| **Security Risks**         | Specific security risks like hacking and fraud related to cryptocurrencies.                   |\n","| **Economic Impact**        | Influence on the companyâ€™s financial performance and economic stability.                      |"]},{"cell_type":"markdown","id":"7769e822","metadata":{"papermill":{"duration":0.005794,"end_time":"2024-07-25T08:23:05.828561","exception":false,"start_time":"2024-07-25T08:23:05.822767","status":"completed"},"tags":[]},"source":["## Data Sources:\n","\n","### **Historical Data:**\n","\n","**Fiat:** \n","- [Top 30 Most Traded Currencies(Wikipedia)](https://en.wikipedia.org/wiki/Template:Most_traded_currencies)\n","- [Historical Price 2001 - 2024(Investing.com)](https://www.investing.com/)\n","\n","**Crypto:** [06/2024 Top 30 By Market Cap(CoinMarketCap)](https://coinmarketcap.com/)\n","\n","**Security Data:** [Cybersecurity Incidents: 2007 - 2022(Carnegie Endowment)](https://carnegieendowment.org/features/fincyber-timeline?lang=en&center=europe)\n","\n","### Adoption Tracker/ Regulation Tracker\n","- [CBDC(Atlantic)](https://www.atlanticcouncil.org/cbdctracker/)\n","- [Cryptocurrency Regulations(Atlantic)](https://www.atlanticcouncil.org/programs/geoeconomics-center/cryptoregulationtracker/)"]},{"cell_type":"markdown","id":"982077c1","metadata":{"papermill":{"duration":0.006928,"end_time":"2024-07-25T08:23:05.842352","exception":false,"start_time":"2024-07-25T08:23:05.835424","status":"completed"},"tags":[]},"source":["## Data Processing\n","\n","### Data Cleaning\n","\n","Downloaded raw data for each currency/cryptocurrency (2001-2024/creation - 2024), Using Excel - picked only relevant columns (date,price), compiled into one dataset.For Cybersecurity incidents - scraped data from source, compiled by Year, then compiled as one.\n","\n","- [Crypto](https://www.kaggle.com/datasets/marvinbulahan/historical-data-of-top-30-fiat-cryptocurrency?select=062024_Top30-MrktCap_Crypto_Historical_data.csv)\n","- [Fiat](https://www.kaggle.com/datasets/marvinbulahan/historical-data-of-top-30-fiat-cryptocurrency?select=062024_Top30-Trading_Fiat_Historical_data.csv)\n","- [Incidents](https://www.kaggle.com/datasets/marvinbulahan/historical-data-of-top-30-fiat-cryptocurrency?select=2007-2022_CyberSecurity_Incidents.csv)\n","\n","For Adoption of Fiat and Cryptocurrencies - will use already available trackers and derive insights\n","\n","- [CBDC (all credits to AtlanticCouncil.org)](https://www.atlanticcouncil.org/cbdctracker/)\n","- [Cryptocurrency Regulations (all credits to AtlanticCouncil.org)](https://www.atlanticcouncil.org/programs/geoeconomics-center/cryptoregulationtracker/)\n","\n","### Data Preparation for Analysis\n","\n","Obtain Summary data for Comparative Analysis by performing Analysis on compiled data for each (Crypto, Fiat, Incidents).\n","\n","- [Cryptocurrency Analysis Report(Excel File)](https://www.kaggle.com/datasets/marvinbulahan/fiat-and-cryptocurrency-comparative-analysis?select=Cryptocurrency+-+ANALYSIS.xlsx)\n","\n","- [Fiat Analysis Report(html)](https://www.kaggle.com/datasets/marvinbulahan/fiat-and-cryptocurrency-comparative-analysis?select=Fiat_EDA.html)/ [Kaggle Notebook](https://www.kaggle.com/code/marvinbulahan/eda-on-fiat-historical-data-2001-2024)\n","\n","- [Cybersecurity Incidents Analysis Report(Tableau)](https://public.tableau.com/views/CybersecurityAnalysisReport/Document?:language=en-US&:sid=&:redirect=auth&:display_count=n&:origin=viz_share_link)\n"]},{"cell_type":"markdown","id":"12b67963","metadata":{"papermill":{"duration":0.007451,"end_time":"2024-07-25T08:23:05.85685","exception":false,"start_time":"2024-07-25T08:23:05.849399","status":"completed"},"tags":[]},"source":["### Tools and Methodology\n","\n","**Cryptocurrency** \n","- Excel, Pivot Table, Dashboard\n","\n","**Fiat**\n","- RStudio, Excel, RMarkdown, Kaggle Notebook\n","\n","**Cybersecurity Incidents**\n","- Tableau, Excel"]},{"cell_type":"markdown","id":"e18c8f61","metadata":{"papermill":{"duration":0.004699,"end_time":"2024-07-25T08:23:05.86638","exception":false,"start_time":"2024-07-25T08:23:05.861681","status":"completed"},"tags":[]},"source":["## Analysis\n","\n","### **Key Insights from Individual Analysis**\n","\n","### Cryptocurrencies\n","-  SHIB (Shiba Inu) stands out with the highest volatility and average percentage change, indicating rapid price fluctuations and growth. In contrast, stablecoins like USDT (Tether) and USDC (USD Coin) exhibit minimal volatility and negligible average percentage changes, maintaining price stability. Major cryptocurrencies such as BTC (Bitcoin) and ETH (Ethereum) show substantial average growth with moderate volatility, while DOGE (Dogecoin) and XRP (Ripple) also display significant growth coupled with higher volatility. Newer cryptocurrencies like SOL (Solana) and PEPE exhibit high growth and volatility, suggesting potential opportunities and risks. Underperformers include BCH (Bitcoin Cash), ICP (Internet Computer), and APT (Aptos), which have negative average growth, indicating a decline in value over time."]},{"cell_type":"markdown","id":"0cc09a81","metadata":{"papermill":{"duration":0.004736,"end_time":"2024-07-25T08:23:05.875744","exception":false,"start_time":"2024-07-25T08:23:05.871008","status":"completed"},"tags":[]},"source":["### Fiat\n","\n","- **Price**: Key findings include that volatility exhibits significant variability but no consistent increase over time. Trend analysis shows that certain currencies, notably CHF, SGD, NZD, and THB, exhibit stable appreciation, while TRY and GBP demonstrate notable depreciation. Most currencies follow seasonal patterns, highlighting the impact of economic and geopolitical factors on currency behavior. The correlation analysis reveals strong correlations among currencies, reflecting shared economic influences or divergent policies. Exchange rate stability is similar across developed and developing economies, indicating comparable stability. Lastly, comparative performance underscores a trade-off between high-growth, high-volatility currencies like BRL and TRY, and stable but low-growth currencies such as HKD and SAR."]},{"cell_type":"markdown","id":"445bd57f","metadata":{"papermill":{"duration":0.00536,"end_time":"2024-07-25T08:23:05.88653","exception":false,"start_time":"2024-07-25T08:23:05.88117","status":"completed"},"tags":[]},"source":["### Security Comparison\n","\n","-  The traditional finance sector remains more frequently targeted by cyberattacks compared to the cryptocurrency sector. Despite the robust cybersecurity practices and regulatory frameworks in place, the traditional finance sector is still experiencing an increasing rate of attacks, especially post-2015. In contrast, the cryptocurrency sector, despite being newer, faces fewer incidents, with the frequency remaining relatively consistent post-2015.\n","\n","- These findings imply that, within the limitations of the data, cryptocurrencies may be more secure than traditional finance. Both sectors need to continuously evolve their cybersecurity strategies to mitigate these threats effectively. Further analysis may enhance the accuracy and validate or invalidate the resulting hypothesis from the analysisÂ especially the adoption rates and regulatory frameworks of both sectors."]},{"cell_type":"markdown","id":"e9ee903c","metadata":{"papermill":{"duration":0.004808,"end_time":"2024-07-25T08:23:05.89642","exception":false,"start_time":"2024-07-25T08:23:05.891612","status":"completed"},"tags":[]},"source":["### **Key Insights From Regulation and Adoption Trends** [(all credits to atlanticcouncil.org)](https://www.atlanticcouncil.org/)\n","\n","- The regulatory environment for cryptocurrencies is evolving as more countries begin to accept and regulate digital currencies. This trend supports their integration into global financial systems and aligns with goals of innovation and security. Despite the presence of partial or general bans in some countries, high adoption rates suggest these restrictions are often ineffective. Significant regulatory updates are anticipated in major economies, which could impact cryptocurrency strategies. Stablecoins, particularly those pegged to the US dollar, are a major focus of new regulations influenced by the EUâ€™s MiCA. However, there are notable gaps in comprehensive regulation, especially in emerging markets. The widespread exploration and implementation of central bank digital currencies (CBDCs) indicate a global shift that could affect the future role of cryptocurrencies.\n","\n","| Category                                                               | Value                                  |\n","|------------------------------------------------------------------------|----------------------------------------|\n","| Countries where cryptocurrency is fully legal                         | 33 out of 60 (55%)                     |\n","| G20 countries where cryptocurrency is fully legal                      | 12 out of 12 (100%)                    |\n","| Countries with partial or general bans                                | 27 (45%)                               |\n","| Percentage of countries making substantial regulatory changes in 2024 | 70%                                    |\n","| G7 countries with stablecoin regulations influenced by MiCA            | 50%                                    |\n","| Countries with comprehensive regulations (taxation, AML/CFT, consumer protection, licensing) | 19 out of 60 (32%)            |\n","| Percentage of emerging markets with comprehensive regulations           | 13%                                    |\n","| Percentage of countries exploring or implementing CBDCs                | Over 90%                               |\n","| Percentage of stablecoins pegged to the US dollar                      | 99%                                    |\n","\n","- Global interest in Central Bank Digital Currencies (CBDCs) has surged, with nearly all major economies now exploring these digital assets. The majority of G20 countries are actively developing CBDCs, and a few have successfully launched them, though some regions face technical challenges. The number of CBDC pilots is at a record high, showcasing widespread experimentation. In contrast, the US is lagging behind, with slow progress and political debate. Different distribution models are being tested, with Chinaâ€™s digital yuan standing out in scale and application. Geopolitical events, such as the Ukraine conflict, have accelerated cross-border CBDC projects, reflecting a shift in global financial dynamics.\n","\n","| Metric                                             | Number | Percentage |\n","|----------------------------------------------------|--------|------------|\n","| Countries & currency unions exploring CBDCs       | 134    | 98%        |\n","| G20 countries in advanced CBDC development        | 19     | 95%        |\n","| Countries with fully launched CBDCs               | 3      | 5%         |\n","| Ongoing CBDC pilots                               | 36     | -          |\n","| US progress on retail CBDCs                       | -      | Stalled    |\n","| Cross-border wholesale CBDC projects              | 13     | -          |\n","| Chinaâ€™s digital yuan wallets                      | 260M   | -          |\n"]},{"cell_type":"markdown","id":"9304b1d8","metadata":{"papermill":{"duration":0.004589,"end_time":"2024-07-25T08:23:05.905606","exception":false,"start_time":"2024-07-25T08:23:05.901017","status":"completed"},"tags":[]},"source":["## Comparative Analysis\n","- More In-Depth(With additional columns for categorizations) Visualizations [HERE]()"]},{"cell_type":"code","execution_count":1,"id":"64aed8cc","metadata":{"execution":{"iopub.execute_input":"2024-07-25T08:23:05.921745Z","iopub.status.busy":"2024-07-25T08:23:05.917973Z","iopub.status.idle":"2024-07-25T08:23:10.386039Z","shell.execute_repl