ata)\n","\n","# Ensure 'type' is a factor with correct levels\n","combined_data$type <- factor(combined_data$type, levels = c('Fiat', 'Crypto'))\n","\n","# Select relevant columns for the scatterplot matrix\n","scatter_data <- combined_data %>%\n","  select(type, volatility, avg_growth, avg_percent_change)\n","\n","# Define a color palette\n","color_palette <- c('Fiat' = '#33ccd0', 'Crypto' = '#fa918a')\n","\n","# Adjust size\n","options(repr.plot.width = 20, repr.plot.height = 10)\n","\n","# Create scatterplot matrix with color scale inside the plot\n","ggpairs(scatter_data, \n","        mapping = aes(color = type, alpha = 0.8),\n","        columns = c('volatility', 'avg_growth', 'avg_percent_change'),\n","        lower = list(continuous = wrap(\"points\", alpha = 0.8)),\n","        diag = list(continuous = wrap(\"densityDiag\", alpha = 0.8)),\n","        upper = list(continuous = wrap(\"cor\", size = 5)),\n","        legend = grab_legend(\n","          ggplot() + \n","            geom_point(aes(x = 1, y = 1, color = \"Fiat\"), size = 3) + \n","            geom_point(aes(x = 1, y = 1, color = \"Crypto\"), size = 3) + \n","            scale_color_manual(values = color_palette)\n","        )\n",") + \n","  theme_bw() +\n","  labs(title = 'Scatterplot Matrix of Cryptocurrency and Fiat Metrics',\n","       subtitle = 'Comparing Volatility, Average Growth, and Average Percent Change',\n","       x = 'Metrics',\n","       y = 'Metrics') +\n","  theme(legend.position = 'right', \n","        legend.title = element_text(size = 12), \n","        legend.text = element_text(size = 10))\n"]},{"cell_type":"code","execution_count":2,"id":"c222a95d","metadata":{"execution":{"iopub.execute_input":"2024-07-25T08:23:10.452994Z","iopub.status.busy":"2024-07-25T08:23:10.413082Z","iopub.status.idle":"2024-07-25T08:23:10.560638Z","shell.execute_reply":"2024-07-25T08:23:10.552311Z"},"papermill":{"duration":0.161848,"end_time":"2024-07-25T08:23:10.56367","exception":false,"start_time":"202