tility          1.0000000  0.5479422          0.9194661\n","avg_growth          0.5479422  1.0000000          0.6235818\n","avg_percent_change  0.9194661  0.6235818          1.0000000\n","                     volatility  avg_growth avg_percent_change\n","volatility         0.000000e+00 0.002020951       1.257533e-07\n","avg_growth         2.020951e-03 0.000000000       3.121000e-04\n","avg_percent_change 1.257533e-07 0.000312100       0.000000e+00\n"]}],"source":["# Load required libraries\n","library(tidyverse)\n","\n","# Load datasets\n","fiat_data <- read.csv('/kaggle/input/final/fiat_performance_metrics.csv')\n","crypto_data <- read.csv('/kaggle/input/final/crypto_performance_metrics.csv')\n","\n","# Add a column to differentiate between fiat and crypto\n","fiat_data$type <- 'Fiat'\n","crypto_data$type <- 'Crypto'\n","\n","# Combine the datasets\n","combined_data <- bind_rows(fiat_data, crypto_data)\n","\n","# Select relevant columns for correlation analysis\n","cor_data <- combined_data %>%\n","  select(type, volatility, avg_growth, avg_percent_change)\n","\n","# Split the data into fiat and crypto datasets\n","fiat_data <- cor_data %>% filter(type == 'Fiat') %>% select(-type)\n","crypto_data <- cor_data %>% filter(type == 'Crypto') %>% select(-type)\n","\n","# Define a function to perform and print correlation tests\n","perform_correlation_tests <- function(data, currency_type) {\n","  cat(\"Correlation Tests for\", currency_type, \":\\n\\n\")\n","  \n","  # Pearson correlation test\n","  cat(\"Pearson Correlation:\\n\")\n","  pearson_cor <- cor(data, method = \"pearson\")\n","  print(pearson_cor)\n","  pearson_pvalues <- cor.mtest(data, method = \"pearson\")$p\n","  print(pearson_pvalues)\n","  \n","  # Spearman rank correlation test\n","  cat(\"\\nSpearman Rank Correlation:\\n\")\n","  spearman_cor <- cor(data, method = \"spearman\")\n","  print(spearman_cor)\n","  spearman_pvalues <- cor.mtest(data, method = \"spearman\")$p\n","  print(spearman_pvalues)\n","}\n","\n","# Function to calculate p-values for correlation matrix\n","cor.mtest <- function(mat, method) {\n","  mat <- as.matrix(mat)\n","  n <- ncol(mat)\n","  p.mat <- matrix(NA, n, n)\n","  for (i in 1:(n - 1)) {\n","    for (j in (i + 1):n) {\n","      tmp <- cor.test(mat[, i], mat[, j], method = method)\n","      p.mat[i, j] <- p.mat[j, i] <- tmp$p.value\n","    }\n","  }\n","  diag(p.mat) <- 0\n","  colnames(p.mat) <- rownames(p.mat) <- colnames(mat)\n","  return(list(p = p.mat))\n","}\n","\n","# Perform correlation tests for fiat data\n","perform_correlation_tests(fiat_data, \"Fiat\")\n","\n","# Perform correlation tests for crypto data\n","perform_correlation_tests(crypto_data, \"Crypto\")\n"]},{"cell_type":"code","execution_count":3,"id":"840f077f","metadata":{"execution":{"iopub.execute_input":"2024-07-25T08:23:10.58671Z","iopub.status.busy":"2024-07-25T08:23:10.585089Z","iopub.status.idle":"2024-07-25T08:23:10.825186Z","shell.execute_reply":"2024-07-25T08:23:10.822759Z"},"papermill":{"duration":0.255199,"end_time":"2024-07-25T08:23:10.82804","exception":false,"start_time":"2024-07-25T08:23:10.572841","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["\u001b[90m# A tibble: 3 Ã— 11\u001b[39m\n","\u001b[90m# Groups:   metric [3]\u001b[39m\n","  metric       estimate estimate1 estimate2 statistic p.value parameter conf.low\n","  \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m           \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m     \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m     \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m     \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m   \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m     \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m    \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m\n","\u001b[90m1\u001b[39m avg_growth    2.76\u001b[90me\u001b[39m+4 \u001b[4m2\u001b[24m\u001b[4m7\u001b[24m771.      170.        1.72  9.57\u001b[90me\u001b[39m\u001b[31m-2\u001b[39m      29.0 -\u001b[31m5\u001b[39m\u001b[31m.\u001b[39m\u001b[31m17\u001b[39m\u001b[90me\u001b[39m+3\n","\u001b[90m2\u001b[39m avg_percentâ€¦  5.52\u001b[90me\u001b[39m\u001b[31m-2\u001b[39m     0.175     0.119     0.757 4.52\u001b[90me\u001b[39m\u001b[31m-1\u001b[39m      56.4 -\u001b[31m9\u001b[39m\u001b[31m.\u001b[39m\u001b[31m10\u001b[39m\u001b[90me\u001b[39m\u001b[31m-2\u001b[39m\n","\u001b[90m3\u001b[39m volatility   -\u001b[31m1\u001b[39m\u001b[31m.\u001b[39m\u001b[31m73\u001b[39m\u001b[90me\u001b[39m+0     0.793     2.52     -\u001b[31m5\u001b[39m\u001b[31m.\u001b[39m\u001b[31m0\u001b[39m\u001b[31m2\u001b[39m  5.82\u001b[90me\u001b[39m\u001b[31m-6\u001b[39m      54.8 -\u001b[31m2\u001b[39m\u001b[31m.\u001b[39m\u001b[31m41\u001b[39m\u001b[90me\u001b[39m+0\n","\u001b[90m# â„¹ 3 more variables: conf.high <dbl>, method <chr>, alternative <chr>\u001b[39m\n"]}],"source":["# Load required libraries\n","library(tidyverse)\n","library(GGally)\n","library(broom)  # For the tidy function\n","\n","# Load datasets\n","fiat_data <- read.csv('/kaggle/input/final/fiat_performance_metrics.csv')\n","crypto_data <- read.csv('/kaggle/input/final/crypto_performance_metrics.csv')\n","\n","# Add a column to differentiate between fiat and crypto\n","fiat_data$type <- 'Fiat'\n","crypto_data$type <- 'Crypto'\n","\n","# Combine the datasets\n","combined_data <- bind_rows(fiat_data, crypto_data)\n","\n","# Select relevant columns for analysis\n","test_data <- combined_data %>%\n","  select(type, volatility, avg_growth, avg_percent_change)\n","\n","# Perform t-tests to compare means between fiat and crypto\n","t_test_results <- test_data %>%\n","  gather(key = \"metric\", value = \"value\", -type) %>%\n","  group_by(metric) %>%\n","  do(tidy(t.test(value ~ type, data = .)))\n","\n","print(t_test_results)"]},{"cell_type":"markdown","id":"a566e2ef","metadata":{"papermill":{"duration":0.009514,"end_time":"2024-07-25T08:23:10.847205","exception":false,"start_time":"2024-07-25T08:23:10.837691","status":"completed"},"tags":[]},"source":["### Findings:\n","| **Hypothesis** | **Metric** | **Value** | **Conclusion** |\n","|----------------|------------|-----------|----------------|\n","| Hypothesis 1: Cryptocurrencies exhibit higher volatility compared to fiat currencies. | Pearson Correlation for Volatility (Fiat) | 0.507 | Cryptocurrencies have a significantly higher correlation with volatility compared to fiat currencies, suggesting that they generally exhibit higher volatility. |\n","|  | Pearson Correlation for Volatility (Crypto) | 0.940 |  |\n","| Hypothesis 2: Cryptocurrencies with higher average growth rates exhibit higher volatility. | Pearson Correlation (Volatility and Average Growth Rate) | 0.267 | The correlation between average growth rate and volatility for cryptocurrencies is positive but moderate in Pearson correlation and stronger in Spearman rank correlation, supporting the hypothesis. |\n","|  | Spearman Rank Correlation (Volatility and Average Growth Rate) | 0.548 |  |\n","| Hypothesis 3: Cryptocurrencies with higher average percent changes have higher volatility. | Pearson Correlation (Volatility and Average Percent Change) | 0.940 | Both Pearson and Spearman correlations are high, indicating a strong positive relationship between average percent change and volatility for cryptocurrencies. |\n","|  | Spearman Rank Correlation (Volatility and Average Percent Change) | 0.919 |  |\n","| Hypothesis 4: The average percent change for cryptocurrencies is more extreme (both positive and negative) compared to fiat currencies. | T-test for Average Percent Change (Cryptocurrencies) | 0.055 | The p-value is high, indicating no significant difference in average percent change between cryptocurrencies and fiat currencies, so this hypothesis is not strongly supported by the data. |\n","|  | T-test for Average Percent Change (Fiat) | 0.119 |  |\n","|  | p-value | 0.452 |  |\n","| Hypothesis 5: Cryptocurrencies with higher average growth rates have higher average percent changes. | Pearson Correlation (Average Growth Rate and Average Percent Change) | 0.317 | The correlation between average growth rate and average percent change for cryptocurrencies is positive but relatively weak in Pearson correlation and stronger in Spearman rank correlation, partially supporting the hypothesis. |\n","|  | Spearman Rank Correlation (Average Growth Rate and Average Percent Change) | 0.624 |  |"]},{"cell_type":"markdown","id":"22162e4d","metadata":{"papermill":{"duration":0.009356,"end_time":"2024-07-25T08:23:10.865878","exception":false,"start_time":"2024-07-25T08:23:10.856522","status":"completed"},"tags":[]},"source":["## Overall Conclusion\n","\n","- The analysis reveals key insights into cryptocurrencies. Compared to traditional currencies, cryptocurrencies are significantly more volatile. There's a positive correlation between growth rate and volatility, along with a strong positive correlation between average percent change and volatility. Interestingly, the average percent change itself isn't significantly different between crypto and fiat currencies. Cybersecurity is a concern for both sectors, though traditional finance seems to be a more frequent target. Regulations are a moving target, with updates and new stablecoin regulations expected. Despite some restrictions, adoption rates for cryptocurrencies remain high. While only a small percentage of countries have fully launched Central Bank Digital Currencies (CBDCs), exploration and development are widespread, particularly among major economies. Notably, the US is lagging behind China in retail CBDC development.\n","\n"]},{"cell_type":"markdown","id":"1db52a9f","metadata":{"papermill":{"duration":0.009377,"end_time":"2024-07-25T08:23:10.884657","exception":false,"start_time":"2024-07-25T08:23:10.87528","status":"completed"},"tags":[]},"source":["## Reccomendation/ Sample Decision - Making Guide"]},{"cell_type":"markdown","id":"ba217634","metadata":{"papermill":{"duration":0.009068,"end_time":"2024-07-25T08:23:10.903112","exception":false,"start_time":"2024-07-25T08:23:10.894044","status":"completed"},"tags":[]},"source":["### Scoring Guide\n","| **Score** | **Interpretation** | **Description** |\n","|-----------|--------------------|-----------------|\n","| 1         | Strongly Oppose: The factor presents significant risks or challenges that outweigh potential benefits. | Indicates that the factor is highly unfavorable, with risks or challenges that strongly outweigh any potential benefits. |\n","| 2         | Oppose: The factor has considerable concerns that may outweigh the benefits. | Indicates that the factor has notable concerns or drawbacks that may overshadow the benefits. |\n","| 3         | Neutral: The factor has both pros and cons that balance each other. | Indicates that the factor presents a balanced view, with neither significant benefits nor drawbacks. |\n","| 4         | Support: The factor presents more benefits than risks, suggesting a positive impact. | Indicates that the factor is favorable, with benefits outweighing the risks or challenges. |\n","| 5         | Strongly Support: The factor strongly favors adoption with significant benefits and minimal risks. | Indicates that the factor is highly favorable, with significant benefits and minimal risks. |\n"]},{"cell_type":"code","execution_count":4,"id":"9cad5338","metadata":{"execution":{"iopub.execute_input":"2024-07-25T08:23:10.925329Z","iopub.status.busy":"2024-07-25T08:23:10.923627Z","iopub.status.idle":"2024-07-25T08:23:11.249584Z","shell.execute_reply":"2024-07-25T08:23:11.247743Z"},"papermill":{"duration":0.348063,"end_time":"2024-07-25T08:23:11.260217","exception":false,"start_time":"2024-07-25T08:23:10.912154","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<!doctype html>\n","<html>\n","\t<head>\n","\t\t<meta charset=\"utf-8\">\n","\t\t<link href=\"data:text/css;charset-utf-8;base64,\" rel=\"stylesheet\" />\n","<script title=\"htmlwidgets\" src=\"data:application/javascript;base64,\"></script>\n","<link href=\"data:text/css;charset-utf-8;base64,\" rel=\"stylesheet\" />\n","<script title=\"datatables-binding\" src=\"data:application/javascript;base64,\"></script>\n","<script title=\"jquery\" src=\"data:application/javascript;base64,\"></script>\n","<script title=\"dt-core\" src=\"data:application/javascript;base64,\"></script>\n","<link href=\"data:text/css;charset-utf-8;base64,\" rel=\"stylesheet\" />\n","<link href=\"data:text/css;charset-utf-8;base64,\" rel=\"stylesheet\" />\n","<script title=\"crosstalk\" src=\"data:application/javascript;base64,\"></script>\n","<link href=\"data:text/css;charset-utf-8;base64,\" rel=\"stylesheet\" />\n","\t</head>\n","\t<body>\n","\t\t<div class=\"datatables html-widget html-fill-item\" id=\"htmlwidget-3919053daa92ab22eede\" style=\"width:100%;height:auto;\"></div>\n","<script type=\"application/json\" data-for=\"htmlwidget-3919053daa92ab22eede\">{\"x\":{\"filter\":\"none\",\"vertical\":false,\"caption\":\"<caption>Decision-Making Ranking Guide with Interpretations<\\/caption>\",\"data\":[[\"1\",\"2\",\"3\",\"4\",\"5\",\"6\"],[\"Volatility\",\"Regulatory Environment\",\"Security\",\"Innovation and Competitive Advantage\",\"Market Adoption and Growth Potential\",\"Economic Impact\"],[\"The degree of volatility associated with cryptocurrencies. Lower volatility is preferred for stability.\",\"The clarity, stability, and alignment of regulatory frameworks concerning cryptocurrencies.\",\"The current security measures and risks associated with cryptocurrencies versus traditional finance.\",\"The potential for cryptocurrencies to drive innovation and provide a competitive edge in the financial sector.\",\"The current adoption rates, market growth potential, and alignment with future trends in cryptocurrency use.\",\"The potential influence of adopting cryptocurrencies on the company's financial performance and stability.\"],[\" \",\" \",\" \",\" \",\" \",\" \"],[\"Cryptocurrencies are more volatile compared to fiat currencies, which may introduce financial risk. Consider whether the company can manage this risk effectively.\",\"A stable and clear regulatory environment supports smoother integration. Given that regulations are evolving, assess whether upcoming regulations align with the company's vision.\",\"Cryptocurrencies face fewer attacks than traditional finance, but they still require robust security measures. Determine if your company can address potential security challenges effectively.\",\"Adoption could enhance innovation and align with the company's vision of being at the forefront of technology. Evaluate if this aligns with your companyâ€™s strategic goals.\",\"High adoption rates and growth potential suggest a favorable environment for integration. Assess whether the potential benefits outweigh the risks and if the company can leverage these trends effectively.\",\"Consider the impact on financial stability and performance. Evaluate if the integration of cryptocurrencies can enhance or disrupt economic stability and performance.\"],[\"No score provided\",\"No score provided\",\"No score provided\",\"No score provided\",\"No score provided\",\"No score provided\"]],\"container\":\"<table class=\\\"display\\\">\\n  <thead>\\n    <tr>\\n      <th> <\\/th>\\n      <th>Factor<\\/th>\\n      <th>Criteria<\\/th>\\n      <th>Score<\\/th>\\n      <th>Justification<\\/th>\\n      <th>Interpretation<\\/th>\\n    <\\/tr>\\n  <\\/thead>\\n<\\/table>\",\"options\":{\"pageLength\":10,\"autoWidth\":true,\"columnDefs\":[{\"orderable\":false,\"targets\":0},{\"name\":\" \",\"targets\":0},{\"name\":\"Factor\",\"targets\":1},{\"name\":\"Criteria\",\"targets\":2},{\"name\":\"Score\",\"targets\":3},{\"name\":\"Justification\",\"targets\":4},{\"name\":\"Interpretation\",\"targets\":5}],\"order\":[],\"orderClasses\":false}},\"evals\":[],\"jsHooks\":[]}</script>\n","\t</body>\n","</html>\n"],"text/plain":["HTML widgets cannot be represented in plain text (need html)"]},"metadata":{"text/html":{"isolated":true}},"output_type":"display_data"}],"source":["# Load the DT library\n","library(DT)\n","\n","# Create a data frame with your table data\n","decision_guide <- data.frame(\n","  Factor = c(\n","    \"Volatility\", \n","    \"Regulatory Environment\", \n","    \"Security\", \n","    \"Innovation and Competitive Advantage\", \n","    \"Market Adoption and Growth Potential\", \n","    \"Economic Impact\"\n","  ),\n","  Criteria = c(\n","    \"The degree of volatility associated with cryptocurrencies. Lower volatility is preferred for stability.\",\n","    \"The clarity, stability, and alignment of regulatory frameworks concerning cryptocurrencies.\",\n","    \"The current security measures and risks associated with cryptocurrencies versus traditional finance.\",\n","    \"The potential for cryptocurrencies to drive innovation and provide a competitive edge in the financial sector.\",\n","    \"The current adoption rates, market growth potential, and alignment with future trends in cryptocurrency use.\",\n","    \"The potential influence of adopting cryptocurrencies on the company's financial performance and stability.\"\n","  ),\n","  Score = c(\n","    \" \",  # INPUT SCORES HERE!!!\n","    \" \",\n","    \" \",\n","    \" \",\n","    \" \",\n","    \" \"\n","  ),\n","  Justification = c(\n","    \"Cryptocurrencies are more volatile compared to fiat currencies, which may introduce financial risk. Consider whether the company can manage this risk effectively.\",\n","    \"A stable and clear regulatory environment supports smoother integration. Given that regulations are evolving, assess whether upcoming regulations align with the company's vision.\",\n","    \"Cryptocurrencies face fewer attacks than traditional finance, but they still require robust security measures. Determine if your company can address potential security challenges effectively.\",\n","    \"Adoption could enhance innovation and align with the company's vision of being at the forefront of technology. Evaluate if this aligns with your companyâ€™s strategic goals.\",\n","    \"High adoption rates and growth potential suggest a favorable environment for integration. Assess whether the potential benefits outweigh the risks and if the company can leverage these trends effectively.\",\n","    \"Consider the impact on financial stability and performance. Evaluate if the integration of cryptocurrencies can enhance or disrupt economic stability and performance.\"\n","  ),\n","  Interpretation = c(\n","    \"\",  # Interpretations based on scores will be generated\n","    \"\",\n","    \"\",\n","    \"\",\n","    \"\",\n","    \"\"\n","  ),\n","  stringsAsFactors = FALSE\n",")\n","\n","# Function to determine interpretation based on score\n","get_interpretation <- function(score) {\n","  switch(\n","    as.character(score),\n","    \"1\" = \"Strongly oppose: The factor presents significant risks or challenges that outweigh potential benefits.\",\n","    \"2\" = \"Oppose: The factor has considerable concerns that may outweigh the benefits.\",\n","    \"3\" = \"Neutral: The factor has both pros and cons that balance each other.\",\n","    \"4\" = \"Support: The factor presents more benefits than risks, suggesting a positive impact.\",\n","    \"5\" = \"Strongly support: The factor strongly favors adoption with significant benefits and minimal risks.\",\n","    \"No score provided\"\n","  )\n","}\n","\n","# Populate Interpretation based on Scores\n","decision_guide$Interpretation <- sapply(decision_guide$Score, get_interpretation)\n","\n","# Display the table using DT\n","datatable(\n","  decision_guide,\n","  options = list(pageLength = 10, autoWidth = TRUE),\n","  caption = 'Decision-Making Ranking Guide with Interpretations'\n",")\n"]},{"cell_type":"markdown","id":"2219c5da","metadata":{"papermill":{"duration":0.018057,"end_time":"2024-07-25T08:23:11.297099","exception":false,"start_time":"2024-07-25T08:23:11.279042","s